import { FETCH_MYLIST } from '../actions/index';

export default function (state = {}, action) {
    switch (action.type) {
      case FETCH_MYLIST:
        const mylist = action.payload.data.result;
        return { ...state, mylist }
      default:
        return state;
    }
  }
